export function throttle(fn, wait, immediate) {
  let timeout;
  let previous = 0;
  if (immediate) {
    return function (...args) {
      const now = Date.now();
      if (now - previous > wait) {
        fn.appy(this, args);
        previous = now;
      }
    };
  } else {
    return function (...args) {
      const context = this;
      if (!timeout) {
        timeout = setTimeout(() => {
          fn.apply(this, args);
          timeout = null;
        }, wait);
      }
    };
  }
}

